import React from "react";
import HelloDiv from "./components/HelloDiv";

function App() {
  return <HelloDiv 
    name="Rupert"
    likesOne="Chocolate!"
    likesTwo="Getting out in nature!"
    likesThree="Watching movies!"
  />;
}

export default App;
